import React, { useEffect } from 'react';
import { Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import Navheader from './navheader';
import gsap from 'gsap';
import './styles.css'; // Make sure to import your CSS

const LandingPage = () => {
  useEffect(() => {
    // GSAP animation for circles
    const circles = document.querySelectorAll('.circle');

    gsap.to(circles, {
      duration: 2,
      opacity: 0,
      repeat: -1,
      yoyo: true,
      stagger: 0.5,
      ease: "power1.inOut"
    });

    // Optional: Set random initial positions for circles
    circles.forEach(circle => {
      gsap.set(circle, {
        x: () => Math.random() * window.innerWidth,
        y: () => Math.random() * window.innerHeight
      });
    });
  }, []);

  return (
    <>
      <Container fluid className='landing-page background'>
        <h1 className='Title'>Find Your Team,</h1>
        <h1 className='Title'>Join the Community.</h1>
        {/* Add circles to the page */}
        <div className="circle"></div>
        <div className="circle"></div>
        <div className="circle"></div>
      </Container>
    </>
  );
};

export default LandingPage;
